import Head from 'next/head';

function About() {
  return(
    <div>
      <Head>
        <title>About</title>
        <meta property="og:title" content="My page title" key="title" />
      </Head>
      <div>About {process.env.customKey}</div>
    </div>
  )
}
  
export default About
